import React, { Component } from "react";
import logo from "./logo.svg";
import "./App.css";
import { books } from "./services/books";
//import { books } from './services/books';

class App extends Component {

  state = { authors: [] };

  componentDidMount() {
    this.setState({ authors: books.authors }); //["Aleph", "Beth"]

  }

  listAuthors() {
    let result = "";
    const authors = this.stats
    for(let i = 0; i < authors.length; i++) {
      result += this.state.authors[i];
    }
    return result;
  }

  render() {
    console.log("STATE: ", this.state);
    return (
      <div className="App">
        <div className="App-header">
          <img src={logo} className="App-logo" alt="logo" />
          <h2>Hello from the Tragic Cavern!</h2>
        </div>   
        {/* <p>{this.state.authors[0]}</p>    */}
        <p>{this.listAuthors}</p>    
      </div>
    );
  }
}

export default App;
